function proper(e){return e.replace(/\w\S*/g,function(e){return e.charAt(0).toUpperCase()+e.substr(1).toLowerCase()})}class workers{constructor(){this.url="https://ws.beagletech.org/"}async request(e,t,r={}){let s;return await $.ajax({type:e,url:this.url+t,data:JSON.stringify(r),success:e=>{s=e},error:e=>{console.log(e),s=e}}),s}}const update_time=async()=>{let e=new workers,t=await e.request("GET","apk/time"),r=["label_driver","label_user"];for(let e=0;e<r.length;e++){let s=r[e],n=proper(s.split("_")[1]),a=t[s.split("_")[1]][0],o=t[s.split("_")[1]][1];document.getElementById(s).innerText=`${n}\n最後更新：${a}\n${o}`}};(function(){const e=document.getElementById("user_btn");update_time();try{const t=new URLSearchParams(window.location.search).get("type");"user"==t&&setTimeout(()=>{e.click()},333)}catch(e){}})();